import { useEffect, useState } from 'react'
import './app.css'

function App() {

  const [no1 , setNo1] = new useState(0);

  useEffect( ()=>{
      document.getElementById('title').innerHTML = 'you clicked this '+no1+' times';
  })

  return (
    <div className="App ">
      <button
        onClick={() => {
          setNo1(no1 + 1);
        }}
      >
        button 1  - {no1}
      </button>


    </div>
  );
}

export default App;
